      "content": "require \"cornerstone\"\n\ntime = Observable(0)\n\n{Modal} = UI = require \"ui\"\n\ndo applyStyle = ->\n  style = document.createElement 'style'\n  style.innerHTML = [\n    UI.Style.modal\n    require \"./style\"\n  ].join(\"\\n\")\n  document.head.appendChild style\n\nTouchCanvas = require \"touch-canvas\"\n\nwidth = height = 360\nt = Observable 0\ndt = Observable 1/60\n\ncanvas = TouchCanvas\n  width: 360\n  height: 360\n\nrun = ->\n  program = CoffeeScript.compile editor.getValue(), bare: true\n  execWithContext program,\n    module: canvas\n\nreset = ->\n  t(0)\n\npaused = false\n\nRenderTemplate = require \"./templates/render\"\n\nrenderOptions =\n  duration: Observable(2)\n  framerate: Observable(30)\n  format: Observable \"gif\"\n  formatOptions: Observable [\n    \"gif\"\n    \"webm\"\n  ]\n  submit: (e) ->\n    e.preventDefault()\n    Modal.hide(renderOptions)\n    # TODO: Display progress bar\n    # TODO: Cancellable render\n\nTemplate = require(\"./template\")\ndocument.body.appendChild Template\n  canvas: canvas.element()\n  run: run\n  render: ->\n    form = RenderTemplate renderOptions\n    Modal.show form, (data) ->\n      if data\n        render[data.format()]\n          duration: data.duration()\n          framerate: data.framerate()\n      else\n        console.log \"cancelled\"\n\n  pause: ->\n    paused = !paused\n\n  reset: reset\n  time: time\n  t: t\n  dt: dt\n\naceShim = require(\"./lib/ace-shim\")()\n\nprogram = PACKAGE.source[\"program/9.coffee\"].content\n\nglobal.editor = aceShim.aceEditor()\neditor.setSession aceShim.initSession program, \"coffee\"\neditor.focus()\n\nupdate = ->\n\nexecWithContext = (program, context={}) ->\n  module = context.module ? {}\n\n  args = Object.keys(context)\n  values = args.map (name) -> context[name]\n\n  update = Function(args..., program).apply(module, values)\n\nrun()\n\nstep = ->\n  # Ensure time is a number\n  currentTime = parseFloat(t()) or 0\n  # Time Display\n  time currentTime.toFixed(2)\n  try\n    update.call(canvas, currentTime, canvas)\n  t(dt() + currentTime) unless paused\n  requestAnimationFrame step\n\nstep()\n\nrender =\n  webm: ({duration, framerate}) ->\n    renderWebm = require \"./render-webm\"\n\n    renderWebm\n      fn: update\n      width: width\n      height: height\n      duration: duration\n      framerate: framerate\n    .then (blob) ->\n      video = document.createElement \"video\"\n      video.loop = true\n      video.autoplay = true\n      video.src = URL.createObjectURL(blob)\n      document.body.appendChild video\n\n  gif: ({duration, framerate}) ->\n    renderGif = require \"./render-gif\"\n  \n    renderGif\n      fn: update\n      width: width\n      height: height\n      duration: duration\n      framerate: framerate\n    .then (blob) ->\n      img = document.createElement \"img\"\n      img.src = URL.createObjectURL(blob)\n      document.body.appendChild img\n",
