      "content": "return (t, canvas) ->\n  {sin, cos, PI, min} = Math\n  canvas = this\n  width = canvas.width()\n  height = canvas.height()\n\n  center = Point(width, height).scale(0.5)\n\n   = PI * 2\n  rot = t * \n\n  canvas.fill(\"black\")\n\n  overallRotation = - rot / 30\n\n  n = 240\n  end = center.add(0, -center.x)\n  [0...n].forEach (i) ->\n    r = 255\n    b = 255 # if i % 2 then 255 else 128\n    canvas.withTransform Matrix.rotation(i * /n + overallRotation, center), (canvas) ->\n      canvas.drawLine\n        start: center.add(Point.fromAngle(-rot / 10).scale(center.x * sin(rot / 50 + i *  / 80)))\n        end: end\n        color: \"rgba(#{r}, 0, #{b}, 1)\"\n",
