          "path": "test/touch",
          "content": "(function() {\n  var TouchCanvas;\n\n  TouchCanvas = require(\"../touch_canvas\");\n\n  describe(\"TouchCanvas\", function() {\n    it(\"should be creatable\", function() {\n      var c;\n      c = TouchCanvas();\n      assert(c);\n      return document.body.appendChild(c.element());\n    });\n    return it(\"should fire events\", function(done) {\n      var canvas, e;\n      canvas = TouchCanvas();\n      canvas.on(\"touch\", function(e) {\n        return done();\n      });\n      e = new Event(\"mousedown\");\n      return canvas.element().dispatchEvent(e);\n    });\n  });\n\n}).call(this);\n",
